contracts/PropertyManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

contract PropertyManagement {
    address public owner;

    struct Property {
        address ownerAddress;
        address landlord;
        string location;
        uint256 rentAmount;
    }

    struct Tenant {
        address tenantAddress;
        address propertyAddress;
        uint256 rentStartDate;
        uint256 rentEndDate;
        bool isTerminated;
        bool landlordConsent;
    }

    mapping(address => Property[]) public properties;
    mapping(address => mapping(address => Tenant)) public propertyTenants;

    event PropertyRegistered(address indexed propertyAddress, address indexed landlord);
    event TenantApproved(address indexed tenantAddress, address indexed propertyAddress);
    event ContractTerminated(address indexed tenantAddress, address indexed propertyAddress);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only contract owner can perform this action");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function registerProperty(string memory _location, uint256 _rentAmount) public {
        Property[] storage userProperties = properties[msg.sender];
        require(userProperties.length == 0, "Property already registered");
        userProperties.push(Property(msg.sender, msg.sender, _location, _rentAmount));
        emit PropertyRegistered(msg.sender, msg.sender);
    }


    function approveTenant(address _propertyAddress, address _tenantAddress, uint256 _startDate, uint256 _endDate) public {
        Property[] storage userProperties = properties[msg.sender];

        bool isOwner = false;
        for (uint i = 0; i < userProperties.length; i++) {
            if (userProperties[i].ownerAddress == msg.sender) {
                isOwner = true;
                break;
            }
        }

        require(isOwner, "Not the property owner");

        propertyTenants[_propertyAddress][_tenantAddress] = Tenant(_tenantAddress, _propertyAddress, _startDate, _endDate, false, false);
        emit TenantApproved(_tenantAddress, _propertyAddress);
    }


    function requestContractTermination(address _propertyAddress) public {
        Tenant storage tenant = propertyTenants[_propertyAddress][msg.sender];
        require(!tenant.isTerminated, "Contract already terminated");
        tenant.isTerminated = true;
        tenant.landlordConsent = false;
    }

   function confirmTermination(address _tenantAddress) public {
        Property[] storage userProperties = properties[msg.sender];
        bool isOwner = false;
        address propertyAddress;

        for (uint i = 0; i < userProperties.length; i++) {
            if (userProperties[i].ownerAddress == msg.sender) {
                propertyAddress = address(userProperties[i].landlord); // Assuming 'landlord' contains the property's address
                isOwner = true;
                break;
            }
        }

        require(isOwner, "Not the property owner");
        require(propertyTenants[propertyAddress][_tenantAddress].isTerminated, "Tenant has not requested termination");

        Tenant storage tenant = propertyTenants[propertyAddress][_tenantAddress];
        tenant.landlordConsent = true;

        if (tenant.landlordConsent) {
            emit ContractTerminated(_tenantAddress, propertyAddress);
        }
    }





     function addProperty(string memory _location, uint256 _rentAmount) public {
        properties[msg.sender].push(Property(msg.sender, msg.sender, _location, _rentAmount));
        emit PropertyRegistered(msg.sender, msg.sender);
    }

     function getPropertyCount() public view returns (uint256) {
        return properties[msg.sender].length;
    }

   function getPropertyDetails(uint256 _propertyIndex) public view returns (address, address, string memory, uint256) {
        require(_propertyIndex < properties[msg.sender].length, "Invalid property index");
        Property memory property = properties[msg.sender][_propertyIndex];
        return (property.ownerAddress, property.landlord, property.location, property.rentAmount);
    }


    function getTenantDetails(address _propertyAddress, address _tenantAddress) public view returns (address, address, uint256, uint256, bool, bool) {
        Tenant memory tenant = propertyTenants[_propertyAddress][_tenantAddress];
        return (tenant.tenantAddress, tenant.propertyAddress, tenant.rentStartDate, tenant.rentEndDate, tenant.isTerminated, tenant.landlordConsent);
    }
}

